import React from 'react';

function Stats() {
    return ( 
       <div className='container'>
        <div className='row'>
            <div className='col-5'>
                <h3>Trust with confidence</h3>
            </div>
             <div className='col-7'>
                <img src='media/images/ecosystem.png' alt='Ecosystem'style={{width:"95%"}}></img>
             </div>
        </div>
       </div>
     );
}

export default Stats;
